import {FcDeleteDatabase} from "react-icons/fc";
const CartItem = ({item}) => {
  return (
    <div className="flex justify-between max-w-[300px]">
      <div>
        <img src={item.image} alt="addedProduct"/>
      </div>
      <div>
        <p>{item.title}</p>
        <p>{item.description.substring(0,200)}...</p>
        <div>
          <p>{item.price}</p>
          <button>
              <FcDeleteDatabase/>
          </button>
        </div>
      </div>
    </div>
  )
};

export default CartItem;
